import ReactDOM from "react-dom";

const myelement = (
    <table>
        <tr>
            <th>Name</th>
        </tr>
        <tr>
            <td>John</td>
        </tr>
        <tr>
            <td>Elsa</td>
        </tr>
    </table>
);

class Car extends React.Component {
    render(){
        return <h2>HI, i am a car</h2>;
    }
}
